import React, { useState, useEffect, useRef } from 'react';
import { Link } from 'react-router-dom';
import Header from '../../components/Header';
import Footer from '../../components/Footer';

interface PricingPlan {
  name: string;
  monthlyPrice: number;
  annualPrice: number;
  period: string;
  description: string;
  features: string[];
  cta: string;
  popular: boolean;
  highlight: string;
}

interface Testimonial {
  quote: string;
  author: string;
  role: string;
  company: string;
}

interface Metric {
  value: string;
  label: string;
}

const Pricing: React.FC = () => {
  const [isAnnual, setIsAnnual] = useState(false);
  const scrollRef = useRef<HTMLDivElement>(null);
  const [scrollPosition, setScrollPosition] = useState(0);

  useEffect(() => {
    const scrollContainer = scrollRef.current;
    if (!scrollContainer) return;

    const scrollWidth = scrollContainer.scrollWidth;
    const clientWidth = scrollContainer.clientWidth;
    const maxScroll = scrollWidth - clientWidth;

    const scroll = () => {
      setScrollPosition((prev) => {
        const newPosition = prev + 1;
        if (newPosition >= maxScroll) {
          // Reset to start when reaching the end
          return 0;
        }
        return newPosition;
      });
    };

    const intervalId = setInterval(scroll, 30); // Adjust speed by changing interval

    return () => clearInterval(intervalId);
  }, []);

  useEffect(() => {
    if (scrollRef.current) {
      scrollRef.current.scrollLeft = scrollPosition;
    }
  }, [scrollPosition]);

  const metrics: Metric[] = [
    { value: '93%', label: 'Customer Satisfaction' },
    { value: '24/7', label: 'Support Available' },
    { value: '14-Day', label: 'Free Trial' },
    { value: '10k+', label: 'Active Users' },
  ];

  const plans: PricingPlan[] = [
    {
      name: 'Starter',
      monthlyPrice: 49,
      annualPrice: 39,
      period: 'month',
      description: 'Perfect for small businesses just getting started with AI',
      features: [
        'Access to Basic AI Agents',
        '1,000 AI interactions per month',
        'Email support',
        'Basic analytics',
        'API access',
      ],
      cta: 'Get Started',
      popular: false,
      highlight: 'Best for Small Teams',
    },
    {
      name: 'Professional',
      monthlyPrice: 99,
